pragma solidity 0.5.1;

import "../Utils/SigUtil.sol";
import "../Utils/SafeMath.sol";
import "../Token/IERC20.sol";
import "./Abstractable.sol";
import "./Account.sol";

/**
 * @title AccountCaller
 * @dev Implementation of the AccountCaller contract
 */

contract AccountCaller is Abstractable {
    using SafeMath for uint256;

    //keccak256(
    //    "EIP712Domain(address verifyingContract)"
    //);
    bytes32 public constant DOMAIN_SEPARATOR_THASH = 0x035aff83d86937d35b32e04f0ddc6ff469290eef2f1b692d8a815c89404d4749;

    bytes public accountByteCode;
    bytes32 public domainSeparator;
    mapping(address => uint256) private nonces;
    mapping(address => mapping(address => uint256)) private gasBooks;

    event ExecutionFailed(bytes32 txHash);
    event Deployed(address signer, address addr);

    constructor(bytes memory _accountByteCode) public {
        require(domainSeparator == 0, "Domain Separator already set!");
        domainSeparator = keccak256(abi.encode(DOMAIN_SEPARATOR_THASH, this));
        accountByteCode = _accountByteCode;
    }

    function callWithDeploy(
        address      _signer,       // only supoprt EOA ECDSA sign
        uint256      _salt,
        address      _to,           // deploy contract via call, if _to == 0x0
        uint256      _value,
        bytes memory _data,
        uint256      _nonce,
        address      _gasToken,
        uint256      _gasPrice,
        uint256      _safeTxGas,
        bytes memory _sig
    ) public returns (bool success) {
        uint256 initialGas = gasleft();
        // validate params
        address payable account = address(uint160(getContractAddress(accountByteCode, _signer, _salt)));

        require(initialGas > _safeTxGas, "not enought gas given");
        // check nonce amount
        require(nonces[account].add(1) == _nonce, "nonce out of order");
        // calculate estimate fee
        require(IERC20(_gasToken).balanceOf(account) >= _safeTxGas.mul(_gasPrice), "_caller hasn't enough balance");

        bytes32 txHash = getTxHash(_signer, _salt, _to, _value, _data, _nonce, _gasToken, _gasPrice, _safeTxGas);

        require(_signer == SigUtil.recover(txHash, _sig), "signer != _from");

        _initAccount(account, _signer, _salt);

        if (_to == address(0x0)) {
            address deployed = Account(account).executeCreate(_data);
            success = deployed != address(0);
            emit Deployed(_signer, deployed);
        } else {
            success = Account(account).executeCall(address(0x0), _to, _value, _data, initialGas);
        }

        if (!success) {
            emit ExecutionFailed(txHash);
        }
        nonces[account] = _nonce;
        uint256 tokenFees = initialGas.sub(gasleft()).mul(_gasPrice);
        // transfer fees
        Account(account).executeCall(_gasToken, msg.sender, tokenFees, "", initialGas);
        return success;
    }

    function setEstimateGasPrice(address _token, uint256 _gasPrice) public returns(bool) {
        gasBooks[_token][msg.sender] = _gasPrice;
        return true;
    }

    function getTxHash(
        address      _signer,       // only supoprt EOA ECDSA sign
        uint256      _salt,
        address      _to,           // deploy contract via call, if _to == 0x0
        uint256      _value,
        bytes memory _data,
        uint256      _nonce,
        address      _gasToken,
        uint256      _gasPrice,
        uint256      _safeTxGas
    ) public view returns (bytes32 txHash) {
        txHash = keccak256(abi.encodePacked(
            "\x19\x01",
            domainSeparator,
            keccak256(abi.encode(
                _signer,
                _salt,
                _to,
                _value,
                keccak256(_data),
                _nonce,
                _gasToken,
                _gasPrice,
                _safeTxGas
            ))
        ));
    }

    function getAccountAddress(address _signer, uint256 _salt) public view returns (address) {
        return getContractAddress(accountByteCode, _signer, _salt);
    }

    function getEstimateGasPrice(address _token, address _relayer) public view returns (uint256) {
        return gasBooks[_token][_relayer];
    }

    function getNonce(address _signer) public view returns (uint256) {
        return nonces[_signer];
    }

    function _initAccount(address account, address _signer, uint256 _salt) internal {
        if (account != getDeployedAddress(_signer, _salt)) {
            address deployed = _deployContract(accountByteCode, _signer, _salt);
            emit Deployed(_signer, deployed);
        }
    }
}
